   <div id="info_block">
      <h2>Interested in hosting a seminar?</h2>
      <p class="info-text">ASU CIDSE would like to invite you to present a seminar to our senior students as part of the CIDSE Capstone Seminar Series.  This series of presentations and panels brings industry representative onto the Tempe ASU campus to talk to students about the skills they need to successfully transition from the academic world to the professional world.  This is a great opportunity for employers to connect directly with students to give advice and build the skills they'll need for their careers.  </p><br/>
      
      <p class="info-text">Seminar events are approximately 1 hour in duration, held during the afternoons throughout the semester, either in-person or remotely.</p><br/>

      <p class="info-text">Topics may include (but are not limited to):</p>
      <p class="info-text">Job search advice (resume & cover letter)</p>
      <p class="info-text"><span class="tab">Interviewing</span></p>
      <p class="info-text"><span class="tab">What to expect during the first year?</span></p>
      <p class="info-text"><span class="tab">Graduate School</span></p>
      <p class="info-text"><span class="tab">Personal Finance</span></p>
      <p class="info-text"> Students are interested in the technologies and processes that you're using!  Please feel free to propose a seminar on a technical or career topic not mentioned here. </p>
      <p class="info-text">Please share this with anyone that might be interested.  </p>
      <p class="info-text"><b>If you are interested in hosting an event, please contact sdosburn@asu.edu</b> to setup a seminar for your organization.</p>
      <p class="info-text"><i>Site created by Ryan Meuth</i></p>

    </div>

    <div id="bottom_block">
      <p id="bottom_block_first">If you have questions or would like more information, please contact sdosburn@asu.edu</p>
      <p id="bottom_block_second"><i>Site created by Ryan Meuth</i></p>
