" jsaction="touchstart:UrsOsc; click:KjsqPd; focusout:QZoaZ; mouseover:y0pDld; mouseout:dq0hvd;fv1Rjc:jbFSOd;CrfLRd:SzACGe;" class="CjVfdc"><div class="PPhIP rviiZ" jsname="haAclf"><div role="presentation" class="U26fgb mUbCce fKz7Od LRAOtb Znu9nd M9Bg4d" jscontroller="mxS5xe" jsaction="click:cOuCgd; mousedown:UX7yZ; mouseup:lbsD7e; mouseenter:tfO1Yc; mouseleave:JywGue; focus:AHmuwe; blur:O22p3e; contextmenu:mg9Pef;" jsshadow="" aria-describedby="h.34oubioxlr40_l" aria-label="Copy heading link" aria-disabled="false" data-tooltip="Copy heading link" aria-hidden="true" data-tooltip-position="top" data-tooltip-vertical-offset="12" data-tooltip-horizontal-offset="0"><a class="FKF6mc TpQm9d" href="#h.34oubioxlr40" aria-label="Copy heading link" jsname="hiK3ld" role="button" aria-describedby="h.34oubioxlr40_l"><div class="VTBa7b MbhUzd" jsname="ksKsZd"></div><span jsslot="" class="xjKiLb"><span class="Ce1Y1c" style="top: -11px"><svg class="OUGEr QdAdhf" width="22px" height="22px" viewBox="0 0 24 24" fill="currentColor" focusable="false"><path d="M0 0h24v24H0z" fill="none"></path><path d="M3.9 12c0-1.71 1.39-3.1 3.1-3.1h4V7H7c-2.76 0-5 2.24-5 5s2.24 5 5 5h4v-1.9H7c-1.71 0-3.1-1.39-3.1-3.1zM8 13h8v-2H8v2zm9-6h-4v1.9h4c1.71 0 3.1 1.39 3.1 3.1s-1.39 3.1-3.1 3.1h-4V17h4c2.76 0 5-2.24 5-5s-2.24-5-5-5z"></path></svg></span></span></a></div></div><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-weight: 700;">Interested in hosting a seminar?</span></div></h3><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">ASU CIDSE would like to invite you to present a seminar to our senior students as part of the </span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 700; text-decoration: none; vertical-align: baseline;">CIDSE Capstone Seminar Series</span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">.&nbsp; This series of presentations and panels brings industry representative onto the Tempe ASU campus to talk to students about the skills they need to successfully transition from the academic world to the professional world.&nbsp; This is a great opportunity for employers to connect directly with students to give advice and build the skills they'll need for their careers.&nbsp;&nbsp;</span></p><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">Seminar events are approximately 1 hour in duration, held during the </span><span class="C9DxTc " style="">afternoons </span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">throughout the semester</span><span class="C9DxTc " style="">, either in-person or remotely.</span></p><br><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">Topics </span><span class="C9DxTc " style="">may </span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">include (but are not limited to):</span></p><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;"><span class="Apple-tab-span " style="white-space: pre;">	</span></span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">Job search advice (resume &amp; cover letter)</span></p><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;"><span class="Apple-tab-span " style="white-space: pre;">	</span></span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">Interviewing</span></p><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;"><span class="Apple-tab-span " style="white-space: pre;">	</span></span><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-decoration: none; vertical-align: baseline;">What to expect during the first year?</span></p><p dir="ltr" class="zfr3Q CDt4Ke " style="margin-left: 0.0pt; margin-right: 0.0pt; padding-left: 0.0pt; text-align: left; text-indent: 0.0pt;"><span class="C9DxTc " style="font-family: 'Open Sans', Arial; font-size: 13.0pt; font-style: normal; font-weight: 400; text-